description:
SG-1 verkent de melkweg door de Stargate en bindt de strijd aan met Apophis, een van de machtigste Goa'uld. De goa'uld zijn een parasitair ras, een soort kleine &quot;slangen&quot;, die een gastheer in bezit nemen. Ze zijn technologisch ontwikkeld en de Jaffa, een ras van krijgers, zijn hen dienstbaar.



